    false,nt"url": null,nt"notes": "NODC accession 0104361 includes biological,
    chemical, optical, physical and underway data collected aboard the THOMAS G. THOMPSON
    during cruise TN256 in the Coastal Waters of SE Alaska from 2010-10-23 to 2010-11-03.
    These data include Attenuation/Transmission, CONDUCTIVITY, CURRENT SPEED - EAST/WEST
    COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V), DEPTH - BOTTOM, DEPTH
    - OBSERVATION, DISSOLVED OXYGEN, FLUORESCENCE, HYDROSTATIC PRESSURE, SALINITY and
    WATER TEMPERATURE. The instruments used to collect these data include ADCP, CTD,
    GPS, echo sounder, fluorometer, oxygen meter and transmissometer. These data were
    collected by William Wilcock of University of Washington, Janet Newton of University
    of Washington; Applied Physics Laboratory, Charles Nittrouer of University of Washington,
    Mitsuhiro Kawase of University of Washington, Elizabeth Armbrust of University of
    Washington, Paul Quay of University of Washington and Kristian Haapa-aho of University
    of Washington as part of Student Cruise/Puget Sound Regional Synthesis Model (PRISM).
    The Lamont-Doherty Earth Observatory (LDEO) submitted these data to NODC as part
    of the NSF sponsored Rolling Deck to Repository (R2R) program. The CTD data submitted
    by the originator represent the raw data suite. Processed versions of the data were
    generated by NODC. The ADCP data represent the raw and automated processed data
    set. Post processed quality assessed data are not available in this accession.",nt"license_title":
